import React, { Component } from "react";
import Square from './Square';

class Card extends Component {
	constructor(props) {
		super(props);

		this.state = {
			count: 0
		};

		// this.increase = this.increase.bind(this);
	}





  render() {
  	var cardStyle = {
  		height: 700,
  		width: 600,
  		padding: 0,
  		backgroundColor: 'grey'
  	}
    return (
    	<div style={cardStyle}>
    		<h1>{this.state.count}</h1>
    		<Square />
    	</div>
    );
  }
}

export default Card	;
